import React from 'react'
import {tick} from '../../Components/3D/bg'
import { useRef } from 'react'

export default function Home() {

  const canvas = useRef()
  
  return (
    <>
    <div>Home</div>
    <canvas ref={canvas} className="webgl"></canvas>
    </>
  )
}
